import React from "react";
import './Artista.css';

export default class Artista extends React.Component {
    render() {
        return (
            <div className="row my-4">
                <div className="col-12 d-flex align-items-center">
                    {/* Renderiza un iframe para mostrar el video de YouTube */}
                    <iframe
                        width="640" // Ancho del video
                        height="390" // Alto del video
                        src={`https://www.youtube.com/embed/${this.props.youtubeId}`} // URL del video de YouTube
                        frameBorder="0"
                        allowFullScreen
                        title={this.props.nombre} // Proporciona un título para accesibilidad
                    ></iframe>

                    <div className="px-3">
                        <h2>{this.props.nombre}</h2>
                        <p>{this.props.descripcion}</p>
                    </div>
                </div>
            </div>
        )
    }
}
